import React from "react";
import logo from "../../images/logo.png"
import "./Header.css"

const Header = () => {
  return <div className="header">
      <img src={logo} alt="" srcset="" />
      <nav>
          <a href="">Shop</a>
          <a href="">Order Review</a>
          <a href=""></a>
          </nav>
  </div>;
};

export default Header;
